// src/App.tsx
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import RequestRide from './pages/RequestRide';  // Tela de Solicitação de Viagem
import TravelHistoryPage from './pages/TravelHistoryPage';  // Tela de Histórico de Viagens

const App: React.FC = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<RequestRide />} />  {/* Página inicial */}
        <Route path="/historico" element={<TravelHistoryPage />} />  {/* Página de histórico */}
      </Routes>
    </Router>
  );
};

export default App;
